<script>
import * as firebase from 'firebase';

export default {
  data() {
    return {
      newUserName: this.$store.getters.user.displayName,
      isEditing: false
    };
  },
  computed: {
    user() {
      return this.$store.getters.user;
    },
    userName(){
      if(this.newUserName){
        return this.newUserName;
      }else{
        return this.$store.getters.user.displayName;
      }
    }
  },
  methods: {
    editProfile() {
      this.isEditing = !this.isEditing;
    },
    showAlert() {
      // Use sweetalert2
      this.$swal("");
    },
    changeProfile(){
      let currentUser = firebase.auth().currentUser;
      currentUser.updateProfile({
        displayName : this.newUserName
      })
      this.$store.dispatch('changeuserprofile' , this.newUserName)
      .then(()=> {
        console.log("changed")
      })


    }
  }
};
</script>
